  \"Black-footed albatross contamination due to global and local contamination\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:46.562147\",\n\t\"name\": \"black-footed-albatross-contamination-due-to-global-and-local-contamination\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study was initiated due to the high
  levels of PCBs (2300 ppm in soil, 660ppb in sediment, 40ppb groundwater) and lead
  (2800 ppm soil) found on Tern Island in French Frigate Shoals (FFS). Pearl and Hermes
  Atoll was not thought to have been used for human exploitation or habitation. Recently,
  it became clear that the Atoll was used to refuel float planes during WWII. At Midway,
  DDT contamination is found with every excavation. Recent monitoring results found
  PCBs in the Midway Atoll fish as high as 25 ppm (dry weight) and 2300 ppb in the
  sediments. These sediment results are even more alarming in that they were taken
  from a high energy area where all debris was removed more than 2 years ago, suggesting
  an unknown source. One third of Sand Island of Midway Atoll is manmade landfill.
  No records exist as to what was used for fill besides coral dredge waste. This year
  two previously unknown USTs were found on Eastern Island, Midway Atoll. Each year
  over 1 million Albatross nest on Midway. Several hundred thousand more nest on the
  other atolls of the Northwest Hawaiian chain. This study attempted to determine
  what effect local contamination has on albatross reproduction and survival, and
  was not able to determine conclusively that local contamination was the only cause
  for elevated concentrations of pollutants in the local albatross.\",\n\t\"license_title\":
